import React, { useState } from 'react';
import AgentChart from '../charts/AgentChart';
import './DashboardPanels.css';

const AgentPerformance = ({ data, formatCurrency }) => {
  const [selectedRegion, setSelectedRegion] = useState('APAC');

  // Transform agent data for the chart
  const transformAgentData = () => {
    const regionData = data.regional_pipeline;
    const agentPerformance = {};

    // Aggregate agent performance across quarters
    Object.values(regionData).forEach(quarterData => {
      const regionAgents = quarterData[selectedRegion] || {};
      Object.entries(regionAgents).forEach(([agent, performance]) => {
        if (!agentPerformance[agent]) {
          agentPerformance[agent] = {
            name: agent,
            value: 0,
            deals: 0
          };
        }
        agentPerformance[agent].value += performance.value;
        agentPerformance[agent].deals += performance.count;
      });
    });

    return Object.values(agentPerformance).sort((a, b) => b.value - a.value);
  };

  const handleRegionChange = (event) => {
    setSelectedRegion(event.target.value);
  };

  const agentData = transformAgentData();
  const totalValue = agentData.reduce((sum, agent) => sum + agent.value, 0);
  const totalDeals = agentData.reduce((sum, agent) => sum + agent.deals, 0);

  return (
    <div className="agent-panel">
      <div className="panel-header">
        <h2 className="panel-title">Agent Performance</h2>
        <select 
          className="region-select" 
          value={selectedRegion} 
          onChange={handleRegionChange}
        >
          <option value="APAC">APAC</option>
          <option value="EMEA">EMEA</option>
          <option value="Americas">Americas</option>
        </select>
      </div>

      <div className="card">
        <div className="region-summary">
          <h3>{selectedRegion} Region Overview</h3>
          <div className="summary-metrics">
            <div className="summary-metric">
              <span className="metric-label">Total Value:</span>
              <span className="metric-value">{formatCurrency(totalValue)}</span>
            </div>
            <div className="summary-metric">
              <span className="metric-label">Total Deals:</span>
              <span className="metric-value">{totalDeals}</span>
            </div>
            <div className="summary-metric">
              <span className="metric-label">Average Deal Size:</span>
              <span className="metric-value">
                {formatCurrency(totalDeals > 0 ? totalValue / totalDeals : 0)}
              </span>
            </div>
          </div>
        </div>

        <div className="agent-performance">
          <h3>Individual Performance</h3>
          <div className="agent-metrics">
            {agentData.map(agent => (
              <div key={agent.name} className="agent-metric">
                <div className="agent-header">
                  <span className="agent-name">{agent.name}</span>
                  <span className="agent-deals">{agent.deals} deals</span>
                </div>
                <div className="agent-value">{formatCurrency(agent.value)}</div>
                <div className="agent-progress-bar">
                  <div 
                    className="agent-progress" 
                    style={{ 
                      width: `${(agent.value / totalValue) * 100}%`
                    }}
                  ></div>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AgentPerformance;
